import React, { Component } from "react";
import fetchUsers from "./utils/getUtils";

class Users extends Component {
  state = { users: null };

  componentDidMount() {
    fetchUsers().then(x => console.log(x));
  }

  render() {
    return <div>List of users:</div>;
  }
}

export default Users;
